const Category = (prop) =>{
    const { cat } = prop;
    return(
        <section className="product-containerhome">
        <div className="headnew">
            <h4>CATEGORIES</h4>
        </div>
        <div className="col-xl-3 col-lg-3 col-md-3 col-sm-6 col-6">
            <div className="card text-center card-product">
                <div className="card-product__img">
                    <img src={ cat.image.sourceUrl} alt="Product image"/>
                </div>
                <div>
                    <h4 className="card-product__title"><a href="#">{ cat.name ? cat.name : '' }</a></h4>
                </div>
            </div>
        </div>
    </section>
    );
}
export default Category;
